import '../../assets/webStyles/form.css'

function FormIdeasM(){
    return(
        <div className='Content'>
            <div className='Title-content-formP'>
                <h1 className='Title-form'>Gracias por compartir tu información.</h1>
            </div>
            <div className='Text-contentP'>
                <p className=''>Ahora cuéntanos qué funcionalidades te gustaría ver en SyncEdu. Tu opinión nos ayuda a construir una mejor plataforma.</p>
            </div>
        </div>
    );
}
export default FormIdeasM;
